import React from 'react'
import ob from './Footer.module.css'

const Footer = () => {
  return (
    <footer className={ob.footer}>
        <p>© 2016-2019 «Need for drive»</p>
        <p>8 (495) 234-22-44</p>
      </footer>
  )
}

export default Footer;
